import { Empty, Layout, Typography,theme,Table } from "antd";


const{Content} = Layout

function EmployeeForm(){
    

    return(
        
        <div>
            <Typography.Title
                style={{
                    textAlign: 'left',
                    color:'black',
                    background:'#f5f5f5',
                    fontWeight:'bold',
                }} level={4}>
                
                    <header className="Employee-Form">Employee Form</header>
            </Typography.Title>
        
            <Layout>
                <Content>
                    <div style={{
                        margin:'16px 16px 0',
                        padding:24,
                        minHeight:500,
                        background:colorBgContainer,
                        textAlign:'center',
                    }}>
                        

                    </div>
         
                </Content>
            </Layout>
        </div>
    )

}
export default EmployeeForm;
